  \"2016-11-25T21:06:26.200633\",\n\t\"name\": \"national-assessment-of-educational-progress-2005-high-school-transcript-study\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The National Assessment of Educational Progress,
  2005 High School Transcript Study (HSTS 2005), is a study that is part of the National
  Assessment of Educational Progress (NAEP) program; program data available since
  1990 at <http://nces.ed.gov/nationsreportcard/naepdata/>. HSTS 2005 (http://nces.ed.gov/nationsreportcard/hsts/)
  is a cross-sectional survey that periodically surveys the curricula being followed
  in our nation's high schools and the coursetaking patterns of high school students
  through a collection of transcripts. For public schools, the HSTS sample included
  every eligible sampled NAEP 2005 twelfth-grade public school that was contacted
  for the HSTS, whether or not they actually participated in the NAEP assessments.
  For private schools, the HSTS sample was a subsample from the NAEP 2005 twelfth-grade
  private school sample for the mathematics and science assessments. The study was
  conducted using a survey of school administrative personnel and collection of students'
  transcripts. Schools participating in the 12th-grade NAEP math and science assessments
  in 2005 were sampled. The studyufffds weighted response rate was 84.2 percent. HSTS
  2005 also offers information on the relationship of student coursetaking patterns
  to achievement at grade 12 as measured by NAEP. Key statistics produced from HSTS
  2005 are information about the types of courses that graduates took, how many credits
  they earned, their grade point averages, and the relationship between coursetaking
  patterns and achievement, as measured by NAEP.\",\n\t\"license_title\": \"Creative
